import React from 'react'
import Card from './Card'

const cards = [{title: 'card a'},{title: 'card b'},{title: 'card c'}]

const PageOne = (props) => {
  return (
    <div>
      { cards.map(elem => {
        return (
          <Card title={elem.title} />
        )
      }
    )}
    </div>
  )
}

export default PageOne
